  return (
    <div className="App">
      <h1>My Favourite Foods</h1>
      <h2>my name is {fname + ' ' + lname}</h2>
      <p> My name is {firstname}</p>
      <p> copyright {YEAR}</p>

      <h4>my age is {Math.floor(Math.random() * 10)}</h4>
      <ul>
        <li>Bacon</li>
        <li>Noodles</li>
        <li>Jamon</li>
      </ul>
    </div>
  );
}
